import React, { Component } from 'react';

class Calibration extends Component {
   confirmClick = () => {
      console.log("clicked")
   };

   render() {
      return (
         <main >
            <div className="jumbotron bg-transparent">
               <h1 className="ml-4">I confirm my volume is 50%</h1>
               <button type="submit" className="btn btn-success" onClick={this.confirmClick}>Finished</button>
            </div>
         </main>
      );
   }
}

export default Calibration;
